    tl1 = FPmul_rn( x[0], y[1] );
    tl2 = FPmul_rn( x[1], y[0] );
    cl = FPadd_rn( cl, FPadd_rn( tl1, tl2 ) );
  #endif
  z[0] = fast_two_sum( ch, cl, z[1] );
